DELIMITER ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `dwumian`(inN int, inK int) RETURNS int(11)
    DETERMINISTIC
BEGIN
DECLARE res int;
WITH RECURSIVE binomial (n, k, val ) AS (
SELECT inN-inK, 0, 1
UNION ALL 
SELECT n + 1, k + 1, ( val*(n+1) ) / (k+1)
FROM binomial WHERE n < inN
)
SELECT val INTO res FROM binomial where k=inK;
RETURN res;
END ;;
DELIMITER ;
