CREATE DEFINER=`root`@`localhost` FUNCTION `laplaceDistribution`(u DOUBLE, b DOUBLE) RETURNS double
    DETERMINISTIC
BEGIN
DECLARE res DOUBLE;
DECLARE uniformV DOUBLE;
SET uniformV = (SELECT RAND() - 0.5);
SET res = ( SELECT (u - b*SIGN(uniformV) * LOG(1 - 2*ABS(uniformV))) );
RETURN res;
END ;;
DELIMITER ;
